script: |
  super -f text -I q12656.spq | sort > q12656.out

inputs:
  - name: q12656.spq
    data: |
      SELECT col0 - - col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN + + col0 * - 10 + + 10 AND - - col1 * + col1 * + - 73;
  - name: tab2

outputs:
  - name: q12656.out
    data: |
